import React from "react";
import HomeIcon from '@mui/icons-material/Home';
import LockOpenIcon from '@mui/icons-material/LockOpen';
import CreditCardIcon from '@mui/icons-material/CreditCard';

// import { FaHome, FaSignInAlt, FaTicketAlt, FaCreditCard } from "react-icons/fa";

import "./navbar_css/Navbar.css"; // Import your CSS file for styling
const Navbar: React.FC<{ setCurrentPage: (page: string) => void }> = ({ setCurrentPage }) => {
  return (
    <nav className="navbar">
      <button onClick={() => setCurrentPage("home")}><HomeIcon /> Trang chủ</button>
      <button onClick={() => setCurrentPage("auth")}><LockOpenIcon /> Đăng Nhập</button>
      <button onClick={() => setCurrentPage("ticketManagement")}> Quản lý vé</button>
      <button onClick={() => setCurrentPage("payment")}><CreditCardIcon /> Thanh toán</button>
      </nav>
  );
};

export default Navbar;
